source.buildSpec:
{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "npm install -g aws-cdk"
      ]
    },
    "build": {
      "commands": [
        "yarn install",
        "yarn build",
        "yarn cdk synth",
        "yarn cdk deploy ai-pipeline-v2 --require-approval never --verbose"
      ]
    }
  },
  "artifacts": {
    "base-directory": "packages/infrastructure/cdk.out",
    "files": "**/*"
  }
}

{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "npm install -g aws-cdk"
      ]
    },
    "build": {
      "commands": [
        "yarn install",
        "yarn build",
        "yarn cdk synth",
        "cp -r node_modules packages/application/dist/lambda/"
      ]
    }
  },
  "artifacts": {
    "base-directory": "packages/**/**",
    "files": "**/*"
  }
}
